INSERT INTO `wp_wc_admin_notes` VALUES (1,'wc-admin-onboarding-email-marketing','info','en_US','Sign up for tips, product updates, and inspiration','We\'re here for you - get tips, product updates and inspiration straight to your email box','{}','unactioned','woocommerce-admin','2021-03-26 07:39:02',NULL,0,'plain','',1,'info'),(2,'wc-admin-marketing-intro','info','en_US','Connect with your audience','Grow your customer base and increase your sales with marketing tools built for WooCommerce.','{}','unactioned','woocommerce-admin','2021-03-26 07:39:02',NULL,0,'plain','',1,'info'),(3,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','{}','unactioned','woocommerce-admin','2021-03-26 07:39:03',NULL,0,'plain','',1,'info'),(4,'facebook_pixel_api_2021','marketing','en_US','Improve the performance of your Facebook ads','Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved performance and measurement of your Facebook ad campaigns.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(5,'facebook_ec_2021','marketing','en_US','Sync your product catalog with Facebook to help boost sales','A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(6,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. Were happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(7,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store ready to sell as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(8,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while theyre shopping on your online store. No more follow-up email requestscustomers get what they want, before theyre done checking out. Learn more about this extension that comes included in your plan.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(9,'wc-admin-getting-started-in-ecommerce','info','en_US','Getting Started in eCommerce - webinar','We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(10,'your-first-product','info','en_US','Your first product','That\'s huge! You\'re well on your way to building a successful online store  now its time to think about how you\'ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','{}','unactioned','woocommerce.com','2021-03-30 01:16:11',NULL,0,'plain','',0,'info'),(11,'wc-square-apple-pay-boost-sales','marketing','en_US','Boost sales with Apple Pay','Now that you accept Apple Pay with Square you can increase conversion rates by letting your customers know that Apple Pay is available. Heres a marketing guide to help you get started.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(12,'wc-square-apple-pay-grow-your-business','marketing','en_US','Grow your business with Square and Apple Pay ','Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(13,'wcpay-apple-pay-boost-sales','marketing','en_US','Boost sales with Apple Pay','Now that you accept Apple Pay with WooCommerce Payments you can increase conversion rates by letting your customers know that Apple Pay is available. Heres a marketing guide to help you get started.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(14,'wcpay-apple-pay-grow-your-business','marketing','en_US','Grow your business with WooCommerce Payments and Apple Pay','Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay.','{}','pending','woocommerce.com','2021-03-26 07:39:04',NULL,0,'plain','',0,'info'),(15,'wc-admin-optimizing-the-checkout-flow','info','en_US','Optimizing the checkout flow','It\'s crucial to get your store\'s checkout as smooth as possible to avoid losing sales. Let\'s take a look at how you can optimize the checkout experience for your shoppers.','{}','unactioned','woocommerce.com','2021-03-30 07:23:18',NULL,0,'plain','',0,'info'),(16,'wc-admin-first-five-things-to-customize','info','en_US','The first 5 things to customize in your store','Deciding what to start with first is tricky. To help you properly prioritize, we\'ve put together this short list of the first few things you should customize in WooCommerce.','{}','unactioned','woocommerce.com','2021-03-29 01:32:23',NULL,0,'plain','',0,'info'),(17,'wc-admin-learn-more-about-variable-products','info','en_US','Learn more about variable products','Variable products are a powerful product type that lets you offer a set of variations on a product, with control over prices, stock, image and more for each variation. They can be used for a product like a shirt, where you can offer a large, medium and small and in different colors.','{}','unactioned','woocommerce-admin','2021-03-26 07:45:38',NULL,0,'plain','',1,'info'),(18,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.','{}','unactioned','woocommerce-admin','2021-03-29 01:20:05',NULL,0,'plain','',1,'info'),(19,'wc-admin-choosing-a-theme','marketing','en_US','Choosing a theme?','Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.','{}','unactioned','woocommerce-admin','2021-03-29 01:20:05',NULL,0,'plain','',1,'info'),(20,'wc-admin-insight-first-product-and-payment','survey','en_US','Insight','More than 80% of new merchants add the first product and have at least one payment method set up during the first week. We\'re here to help your business succeed! Do you find this type of insight useful?','{}','unactioned','woocommerce-admin','2021-03-29 01:20:05',NULL,0,'plain','',1,'info'),(21,'wc-admin-customizing-product-catalog','info','en_US','How to customize your product catalog','You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.','{}','unactioned','woocommerce-admin','2021-03-29 01:20:05',NULL,0,'plain','',1,'info'),(22,'wc-admin-filter-by-product-variations-in-reports','info','en_US','Baru - penyaringan berdasarkan variasi produk dalam laporan pesanan dan produk','Telah hadir, salah satu fitur yang paling ditunggu! Anda sekarang dapat mengetahui tiap variasi produk dalam laporan pesanan dan produk.','{}','unactioned','woocommerce-admin','2021-03-30 01:05:00',NULL,0,'banner','http://localhost/project1/wp-content/plugins/woocommerce/packages/woocommerce-admin/images/admin_notes/filter-by-product-variations-note.svg',1,'info'),(23,'storefront-customize','info','en_US','Design your store with Storefront ','Visit the Storefront settings page to start setup and customization of your shop.','{}','unactioned','storefront','2021-03-30 01:20:42',NULL,0,'plain','',1,'info'),(24,'wc-admin-launch-checklist','info','en_US','Siap meluncurkan toko Anda?','Untuk memastikan Anda tidak merasa melupakan sesuatu, kami telah menyusun daftar periksa pra-peluncuran yang penting.','{}','unactioned','woocommerce-admin','2021-03-30 07:40:39',NULL,0,'plain','',1,'info'),(25,'wc-admin-coupon-page-moved','update','en_US','Manajemen kupon telah dipindahkan!','Kupon kini bisa dikelola dari Pemasaran &gt; Kupon. Klik tombol di bawah ini untuk menghapus WooCommerce legasi &gt; Item menu kupon.','{}','actioned','woocommerce-admin','2021-03-31 02:11:38',NULL,0,'plain','',0,'info'),(26,'wcpay-apple-pay-is-now-available','marketing','en_US','Apple Pay is now available with WooCommerce Payments!','Increase your conversion rate by offering a fast and secure checkout with <a href=\"https://woocommerce.com/apple-pay/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">Apple Pay</a>. Its free to get started with <a href=\"https://woocommerce.com/payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">WooCommerce Payments</a>.','{}','pending','woocommerce.com','2021-03-31 14:06:54',NULL,0,'plain','',0,'info'),(28,'paypal_ppcp_gtm_2021','marketing','en_US','Offer more options with the new PayPal','Get the latest PayPal extension for a full suite of payment methods with extensive currency and country coverage.','{}','pending','woocommerce.com','2021-04-02 11:24:03',NULL,0,'plain','',0,'info'),(29,'wc-admin-store-notice-giving-feedback-2','info','en_US','Anda diajak untuk berbagi pengalaman','Setelah Anda memilih kami sebagai mitra, tujuan kami adalah memastikan bahwa kami memberikan alat yang tepat untuk memenuhi kebutuhan Anda. Kami menantikan masukan Anda mengenai pengalaman penyiapan toko, sehingga kami dapat memperbaikinya di masa mendatang.','{}','unactioned','woocommerce-admin','2021-04-04 08:55:42',NULL,0,'plain','',0,'info'),(30,'wc-admin-insight-first-sale','survey','en_US','Tahukah Anda?','Toko berbasis WooCommerce membutuhkan rata-rata 31 hari untuk mendapatkan penjualan pertama. Pilihan Anda sudah tepat! Apakah menurut Anda tipe wawasan ini bermanfaat?','{}','unactioned','woocommerce-admin','2021-04-04 08:55:42',NULL,0,'plain','',0,'info'),(32,'wc-admin-first-downloadable-product','info','en_US','Pelajari selengkapnya tentang produk digital/yang dapat diunduh','Selamat telah menambahkan produk digital pertama Anda! Sekarang Anda dapat mempelajari lebih lanjut tentang cara menangani produk digital atau produk yang dapat diunduh menggunakan dokumentasi kami.','{}','unactioned','woocommerce-admin','2021-04-14 17:33:42',NULL,0,'plain','',0,'info'),(33,'wc-admin-orders-milestone','info','en_US','Selamat Anda telah memproses 10 pesanan!','Anda telah meraih pencapaian 10 pesanan! Lihat pencapaian Anda. Jelajahi beberapa kisah sukses WooCommerce untuk inspirasi.','{}','unactioned','woocommerce-admin','2021-04-15 23:40:26',NULL,0,'plain','',0,'info'),(35,'wc-payments-qualitative-feedback','info','en_US','WooCommerce Payments setup - let us know what you think','Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.','{}','pending','woocommerce.com','2021-04-16 07:40:30',NULL,0,'plain','',0,'info'),(36,'wc-admin-new-sales-record','info','en_US','Rekor penjualan baru!','Woohoo, April 17th adalah hari rekor Anda untuk penjualan! Penjuala Bersih Rp1.031.016 mengalahkan rekor sebelumnya sebesar Rp386.636 yang terjadi pada April 15th.','{\"old_record_date\":\"2021-04-15\",\"old_record_amt\":386636,\"new_record_date\":\"2021-04-17\",\"new_record_amt\":1031016}','unactioned','woocommerce-admin','2021-04-18 07:51:25',NULL,0,'plain','',0,'info');
